export class KeycloakService {
  tokenKey = 'frontend_auth_token';
  loginDemo() {
    localStorage.setItem(this.tokenKey, 'demo-token');
  }
  logout() {
    localStorage.removeItem(this.tokenKey);
  }
  isAuthenticated() {
    return !!localStorage.getItem(this.tokenKey);
  }
  getToken() {
    return localStorage.getItem(this.tokenKey);
  }
}
